// FailedEmailVerification.js
import React from 'react';
import { Link } from 'react-router-dom';
import '../styles/EmailVerification.css'; // Import the CSS for styling

function FailedEmailVerification() {
    return (
        <div className="email-verification-container">
            <div className="email-verification-message">
                <h2 className="error-title">Email Verification Failed</h2>
                <p className="error-text">Sorry, email verification failed. Please try again or contact support.</p>
                <Link to="/login" className="home-button">Go to Login</Link>
            </div>
        </div>
    );
}

export default FailedEmailVerification;
